function SpendMoneyGame() {
  // --- State Management ---
  const [money, setMoney] = useState(BILL_GATES_MONEY);
  const [cart, setCart] = useState({});
  const [justification, setJustification] = useState('');
  const [isLoading, setIsLoading] = useState(false);

  // --- Core Logic Functions ---
  const buyItem = (item) => {
    if (money >= item.price) {
      setMoney(prevMoney => prevMoney - item.price);
      setCart(prevCart => ({ ...prevCart, [item.id]: (prevCart[item.id] || 0) + 1 }));
    }
  };

  const sellItem = (item) => {
    if (cart[item.id] > 0) {
      setMoney(prevMoney => prevMoney + item.price);
      setCart(prevCart => {
        const newCart = { ...prevCart };
        newCart[item.id] -= 1;
        if (newCart[item.id] === 0) delete newCart[item.id];
        return newCart;
      });
    }
  };

  const totalSpent = useMemo(() => BILL_GATES_MONEY - money, [money]);
  const cartItems = useMemo(() => Object.keys(cart).map(itemId => {
    const item = items.find(i => i.id === parseInt(itemId));
    return `${cart[itemId]}x ${item.name}`;
  }).join(', '), [cart]);

  // --- Gemini API Call ---
  const justifyPurchases = async () => {
    setIsLoading(true);
    setJustification('');

    const systemPrompt = "You are an eccentric billionaire assistant. Your job is to justify the user's absurd spending spree with confidence and flair. Be creative and funny. Address the user directly.";
    const userQuery = `I just spent a fortune and bought the following items: ${cartItems}. Justify these purchases for me.`;

    const apiKey = ""; // Canvas will provide this
    const apiUrl = `https://generativelanguage.googleapis.com/v1beta/models/gemini-2.5-flash-preview-05-20:generateContent?key=${apiKey}`;
    
    const payload = {
      contents: [{ parts: [{ text: userQuery }] }],
      systemInstruction: {
        parts: [{ text: systemPrompt }]
      },
    };

    try {
      const response = await fetch(apiUrl, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(payload)
      });
      const result = await response.json();
      const text = result.candidates?.[0]?.content?.parts?.[0]?.text;
      if (text) {
        setJustification(text);
      } else {
        setJustification("The AI seems to be at a loss for words... and frankly, so am I.");
      }
    } catch (error) {
      console.error("Error calling Gemini API:", error);
      setJustification("There was an error contacting your financial advisor (the AI). Try again later.");
    } finally {
      setIsLoading(false);
    }
  };


  return (
    <>
      <GameStyles />
      <div className="spend-money-game">
        <header className="header">
          <img 
              src="https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcRWQz1D5e61MR6WED7RrF4F6cU5umKipO8elMw7sEyRLU7Cs9YNPk8Ck0krztiMvGnKdKnCPw7yLJ8epUZt9oex9y17dt92HxTJlIZ6fQQL" 
              alt="Bill Gates" 
              className="profile-pic"
          />
          <h1 className="title">Spend Bill Gates' Money</h1>
        </header>
        
        {/* NEW: Sticky money bar */}
        <div className="money-bar">
          <div className="money-display">{moneyFormatter.format(money)}</div>
        </div>
        
        <main>
          <div className="items-grid">
            {items.map(item => (
              <div key={item.id} className="item-card">
                <img src={item.image} alt={item.name} className="item-image" />
                <h2 className="item-name">{item.name}</h2>
                <p className="item-price">{moneyFormatter.format(item.price)}</p>
                <div className="controls">
                  <button onClick={() => sellItem(item)} disabled={!cart[item.id]} className="control-btn sell-btn">Sell</button>
                  <span className="quantity">{cart[item.id] || 0}</span>
                  <button onClick={() => buyItem(item)} disabled={money < item.price} className="control-btn buy-btn">Buy</button>
                </div>
              </div>
            ))}
          </div>

          {totalSpent > 0 && (
            <div className="receipt">
                <h2 className="receipt-title">Your Receipt</h2>
                {Object.keys(cart).map(itemId => {
                    const item = items.find(i => i.id === parseInt(itemId));
                    return (
                        <div key={item.id} className="receipt-item">
                            <span>{item.name} x{cart[itemId]}</span>
                            <span>{moneyFormatter.format(item.price * cart[itemId])}</span>
                        </div>
                    );
                })}
                <div className="receipt-total">
                    <span>TOTAL SPENT</span>
                    <span>{moneyFormatter.format(totalSpent)}</span>
                </div>
                <button 
                  onClick={justifyPurchases} 
                  disabled={isLoading} 
                  className="justify-btn"
                >
                  {isLoading ? 'Consulting the AI...' : ' Justify My Purchases'}
                </button>
                {justification && (
                  <div className="ai-justification">
                    {justification}
                  </div>
                )}
            </div>
          )}
        </main>
      </div>
    </>
  );
}

